class TodoList extends Component {
  arrTodo=[];element;
    constructor(props) {
      super(props)

      this.state = {
        arrTodo:this.props.arrTodo,
      }

    }
    componentDidMount=()=>{
      this.arrTodo=this.props.arrTodo;
       this.element=this.arrTodo.map=(item=>{
        return(
          <li>{item}</li>
        )
       })
    }
  render() {

    return (
      <>
        <h3>Todo</h3>
        <ul id="incomplete-tasks">
        {this.state.data.map(d => (<li key={d.id}>{d.name}</li>))} 
        </ul>
      </>
    );
  }
}

export default TodoList;
